import React from 'react';
import BeerCol from './BeerCol';
import './css/BeerCol.css';

function BeerRow(props) {
  if (props.beerList.length === 1) {
    return (<div className="beer-row">
              <BeerCol attributes={props.beerList[0]}></BeerCol>
            </div>);
  }
  else if (props.beerList.length === 2) {
    return (<div className="row">
              <BeerCol attributes={props.beerList[0]}></BeerCol>
              <BeerCol attributes={props.beerList[1]}></BeerCol>
            </div>);
  }
  else if (props.beerList.length === 3) {
    return (<div className="row">
              <BeerCol attributes={props.beerList[0]}></BeerCol>
              <BeerCol attributes={props.beerList[1]}></BeerCol>
              <BeerCol attributes={props.beerList[2]}></BeerCol>
            </div>);
  }
}

export default BeerRow;
